@Test
    public void tryToGetInstanceWithNullReason() {
        assertThatNullPointerException()
                .isThrownBy(() -> Shutdown.getInstance(null, dittoHeaders))
                .withMessageContaining("ShutdownReason")
                .withMessageContaining("must not be null")
                .withNoCause();
    }

